","endDate":"2016-12-14 19:00:00"}],"topLineInfo":"","promoterName":"","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":null,"ageLimit":"","showTypeCode":null,"showType":"","eventStatusCode":"BUY","eventStatus":"Buy","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1289515?utm_medium=api","ticketPrice":"$12.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":"","facebookEventIdString":"","headliners":[{"id":1676803,"name":"You Won't","startTime":null,"eventDescription":"You Won't is the musical duo of Josh Arnoudse and Raky Sastri, who first met in 1999 as unlikely fencing partners in a high school production of the Broadway flop "My Favorite Year."  Some 17 years later, they are still collaborating closely but no longer assaulting each other with pointy metal rods.  Since the release of their full-length debut "Skeptic Goodbye" in 2012, You Won't has toured across North America, garnering praise from the likes of SPIN, NPR, KEXP, and The New York Times for their raggedly infectious and charmingly idiosyncratic sound.  Their dynamic and enthusiastically unorthodox live performances have earned them supports slots with The Lumineers, The Joy Formidable, Josh Ritter, Lucius, and Deer Tick, and an appearance on NBC's Last Call with Carson Daly.  Their mixed feelings about social media have earned them scorn and derision. 

"Revolutionaries", the band's second LP, is at its heart a reflection on the crumbling of youthful idealism in the face of the compromises and moral ambiguities of adulthood.  The title pays tribute both to the duo's childhood home of Lexington, Massachusetts (site of the first battle of the American Revolution) and to the enduring, quixotic sense of shared purpose that has fueled their creative partnership for more than a decade and a half.  Prior to forming You Won't in early 2011, Arnoudse and Sastri had already been making theater, films, and music together for nearly a dozen years, enduring countless false starts, disappointments, and disillusionments along the way but never wavering in their support for each other and their collaborative vision.  Their platonic marriage as a two-man rock'n'roll band proved the biggest challenge yet to this sacred artistic mission, and not coincidentally "Revolutionaries" is rife with references to shaken beliefs, shifting loyalties, and wounded pride.   

Self-produced by the band at home over a period of two and a half years, "Revolutionaries" is the product of a long, often Sisyphean recording process and approximately 10,000 hours spent banging foreheads against walls.  The album's raw, driving, cacophonous aesthetic is more expansive and sonically adventurous than that of its predecessor, the natural outgrowth of the four-legged noise circus You Won't has been bringing to dive bars and rock clubs across the US for the past few years.  At its musical core is the merging of Arnoudse's evocative lyrics, lilting melodies and punk-infused guitar with Sastri's nimble, jazz-inflected percussion and seemingly endless supply of obscure instrumentation (whirly tubes, electronic bagpipes, and singing saw are all employed here).  Over 15 intertwining tracks, "Revolutionaries" tells a story of wrong turns, curveballs, and injured buttocks, interspersed with the occasional moment of unexpected clarity.  Taken as a whole, the album is a thoughtful and frequently witty meditation on what we choose to believe, who we choose to believe in, and how these choices shape our lives.  Most importantly, it represents the latest and most public salvo in a revolution that the members of You Won't have privately been leading, in some form or another, for the past 17 years.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atjmbo.png","width":960,"height":1484},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atjmbo1.png","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atlg.png","width":300,"height":464},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atlg1.png","width":300,"height":200},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atmd.png","width":200,"height":309},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atmd1.png","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-og.png","width":1325,"height":2048},"small":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atsm.png","width":100,"height":155},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atsm1.png","width":100,"height":67},"square":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-sq.png","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-sqsm.png","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atxl.png","width":500,"height":773},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atxl1.png","width":500,"height":334},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atxxl.png","width":650,"height":1005},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/24/11/57-atxxl1.png","width":650,"height":433}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://youwontmusic.com/","urlMySpace":"","urlFacebook":"http://www.facebook.com/youwontmusic","urlTwitter":"http://twitter.com/youwontmusic","twitterScreenName":"youwontmusic"}],"supports":[],"urlEventDetailsUrl":"http://www.ticketfly.com/event/1289515?utm_medium=api"}]}
